let equip = msg.payload;
let data = [];
let i=0;
let n_equip = equip.length;
let myobj = {};

for(i=0;i<n_equip;i++){
    myobj = {
        label:equip[i],
        backgroundColor: "rgba(" + Math.floor(Math.random()*255) +","+ Math.floor(Math.random()*255)+", 0, 1.0)",
        borderColor: "#000",
        data: [
            {x:Math.random()*6, y:Math.random()*9, r:10}
        ]
    }
    data.push(myobj);
}

msg.payload = data;
return msg;
